import React from 'react';

class EmployeeDetail extends React.Component {
    render() {
        let { selectedEmployee } = this.props;

        if (!!selectedEmployee) {
            detailItems = 
                <ul>
                    <li>ID: {item.EmployeeID}</li>
                    <li>Employee Number: {item.EmployeeNumber}</li>
                    <li>Employee Name: {item.FirstName} {item.LastName} </li>
                    <li>Date Joined: {item.DateJoined}</li>
                    <li>Extension: {item.Extension}</li>
                    <li>RoleID: {item.RoleID}</li>
                </ul>
            ;
        }
        return (
            <div id="employee-detail">
                {detailItems}
            </div>
        );
    }
}

export { EmployeeDetail }
